import React from "react";
import Login from "./components/Login";
import UserRegistration from "./components/UserRegistration";
import BookRegistration from "./components/BookRegistration";
import EditionRegistration from "./components/EditionRegistration";
import PublisherRegistration from "./components/PublisherRegistration";
import GenreRegistration from "./components/GenreRegistration";
import AuthorRegistration from "./components/AuthorRegistration";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import "./App.css";

const App = () => {
  <Router>
    <Switch>
      <Route exact path="/" component={Login} />
      <Route exact path="/user-registration" component={UserRegistration} />
      <Route exact path="/book-registration" component={BookRegistration} />
      <Route
        exact
        path="/edition-registration"
        component={EditionRegistration}
      />
      <Route
        exact
        path="/publisher-registration"
        component={PublisherRegistration}
      />
      <Route exact path="/genre-registration" component={GenreRegistration} />
    </Switch>
  </Router>;
  return <div className="App"></div>;
};

export default App;
